import React from "react";
import PageHeader from "../components/PageHeader";

export default function ContactPage() {
    const titleText = "Contact";
    const subTitleText = "";
    return (
        <div>
            <PageHeader title={ titleText } subtitle={ subTitleText }/>
            <div className="row justify-content-center contact-body">
                <div className="col-8">
                    <ul className="contact-list">
                        <li className="contact-item">1</li>
                        <li className="contact-item">2</li>
                        <li className="contact-item">3</li>
                        <li className="contact-item">4</li>
                        <li className="contact-item">5</li>
                        <li className="contact-item">6</li>
                    </ul>
                </div>
            </div>
        </div>
    );
}
